// Verified Network fee distribution
// (c) Kallol Borah, 2021

//"SPDX-License-Identifier: UNLICENSED"

pragma solidity 0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

import "./interfaces/ViaFactory.sol";

contract Distribution is Ownable, Pausable {

    using SafeMath for uint256;

    ViaFactory factory;
    
    mapping(bytes32 => address[]) private businesses;
    mapping(address => uint256) private businessIndex;
    mapping(bytes32 => address[]) private operators;
    mapping(address => uint256) private operatorIndex;
    
    address private founder;
    address private treasury;

    uint256 private immutable businessShare;
    uint256 private immutable founderShare;
    uint256 private immutable investorShare;
    uint256 private immutable operatorShare;

    constructor(uint256 _business, uint256 _royalty, uint256 _investor, uint256 _operator){ 
        businessShare = _business;
        founderShare = _royalty;
        investorShare = _investor;
        operatorShare = _operator;
    }

    function initialize(address _viaFactory, address _founder, address _treasury) onlyOwner public {
        factory = ViaFactory(_viaFactory);
        founder = _founder;
        treasury = _treasury;
    }

    function addRevenueShareholder(bytes32 _type, address _shareholder, bytes32 _currency) onlyOwner external {
        if(_type=="Business"){
            if(businessIndex[_shareholder] == 0){
                businesses[_currency].push(_shareholder);
                businessIndex[_shareholder] = businesses[_currency].length;
            }
        }
        else if(_type=="Operator"){
            if(operatorIndex[_shareholder] == 0){
                operators[_currency].push(_shareholder);
                operatorIndex[_shareholder] = operators[_currency].length;
            }
        }    
    }

    function getRevenueShareholders(bytes32 _type, bytes32 _currency) onlyOwner external view returns(address[] memory shareholders){
        if(_type=="Business")
            return businesses[_currency];
        else if(_type=="Operator")
            return operators[_currency];
    }


    function getPaymentFeeCollected(bytes32 _currency) onlyOwner external view returns(uint256){
        address cashToken = factory.getIssuer("ViaCash", _currency);
        return (IERC20(cashToken).balanceOf(address(this)));
    }     

    function getLoanFeeCollected(bytes32 _currency) onlyOwner external view returns(uint256){
        address bondToken = factory.getIssuer("ViaBond", _currency);
        return (IERC20(bondToken).balanceOf(address(this)));
    } 

    function shareFee() onlyOwner external {
        uint256 tokenCount = factory.getTokenCount();
        for(uint i=0; i<tokenCount; i++){
            address token = factory.getToken(i);
            (bytes32 tokenName, bytes32 tokenType) = factory.getNameAndType(token);             
            if(tokenType=="ViaCash"){
                address cashToken = factory.getIssuer("ViaCash", tokenName);
                uint256 fee = IERC20(cashToken).balanceOf(address(this));
                uint256 businessFee = SafeMath.div(SafeMath.mul(fee, businessShare), businesses[tokenName].length);
                uint256 operatorFee = SafeMath.div(SafeMath.mul(fee, operatorShare), operators[tokenName].length);
                IERC20(cashToken).transferFrom(address(this), founder, SafeMath.mul(fee, founderShare));
                IERC20(cashToken).transferFrom(address(this), treasury, SafeMath.mul(fee, investorShare));
                for(uint j=0; j<businesses[tokenName].length; j++){
                    IERC20(cashToken).transferFrom(address(this), businesses[tokenName][j], businessFee);
                }
                for(uint j=0; j<operators[tokenName].length; j++){
                    IERC20(cashToken).transferFrom(address(this), operators[tokenName][j], operatorFee);
                }
            }
            else if(tokenType=="ViaBond"){
                address bondToken = factory.getIssuer("ViaBond", tokenName);
                uint256 fee = IERC20(bondToken).balanceOf(address(this));
                uint256 businessFee = SafeMath.div(SafeMath.mul(fee, businessShare), businesses[tokenName].length);
                uint256 operatorFee = SafeMath.div(SafeMath.mul(fee, operatorShare), operators[tokenName].length);
                IERC20(bondToken).transferFrom(address(this), founder, SafeMath.mul(fee, founderShare));
                IERC20(bondToken).transferFrom(address(this), treasury, SafeMath.mul(fee, investorShare));
                for(uint j=0; j<businesses[tokenName].length; j++){
                    IERC20(bondToken).transferFrom(address(this), businesses[tokenName][j], businessFee);
                }
                for(uint j=0; j<operators[tokenName].length; j++){
                    IERC20(bondToken).transferFrom(address(this), operators[tokenName][j], operatorFee);
                }
            }
        }
    }

}
